<p>you have this:</p>
<pre data-code-wrap="java"><code class="lang-java">package frc.robot.subsystems;

import edu.wpi.first.wpilibj.AddressableLED;
import edu.wpi.first.wpilibj.AddressableLEDBuffer;
import edu.wpi.first.wpilibj.LEDPattern;
import edu.wpi.first.wpilibj.util.Color;
import edu.wpi.first.wpilibj2.command.SubsystemBase;

public class LedSubsystem extends SubsystemBase{

    AddressableLED led;
    AddressableLEDBuffer buffer;

    LEDPattern pattern;

    public LedSubsystem(){

        this.led = new AddressableLED(9);
        this.buffer = new AddressableLEDBuffer(60);
        this.pattern = LEDPattern.solid(Color.kAquamarine);

        led.setLength(buffer.getLength());
        pattern.applyTo(buffer);
        led.start();
    }

    @Override
    public void periodic() {
        led.setData(buffer);
    }
}
</code></pre>
<p>and the example <a href="https://docs.wpilib.org/en/stable/docs/software/hardware-apis/misc/addressable-leds.html" rel="noopener nofollow ugc">from WPILib</a> has this:</p>
<pre data-code-wrap="java"><code class="lang-java">public class LEDSubsystem extends SubsystemBase {
  private static final int kPort = 9;
  private static final int kLength = 120;

  private final AddressableLED m_led;
  private final AddressableLEDBuffer m_buffer;

  public LEDSubsystem() {
    m_led = new AddressableLED(kPort);
    m_buffer = new AddressableLEDBuffer(kLength);
    m_led.setLength(kLength);
    m_led.start();

    // Set the default command to turn the strip off, otherwise the last colors written by
    // the last command to run will continue to be displayed.
    // Note: Other default patterns could be used instead!
    setDefaultCommand(runPattern(LEDPattern.solid(Color.kBlack)).withName("Off"));
  }

  @Override
  public void periodic() {
    // Periodically send the latest LED color data to the LED strip for it to display
    m_led.setData(m_buffer);
  }

  /**
   * Creates a command that runs a pattern on the entire LED strip.
   *
   * @param pattern the LED pattern to run
   */
  public Command runPattern(LEDPattern pattern) {
    return run(() -&gt; pattern.applyTo(m_buffer));
  }
}
</code></pre>
